import React from "react";
import "./style.css";

function Footer() {
  return (
    <footer className="footer">
      <span><div class="container"><p class="footer-social"><a href="//www.facebook.com/" target="_blank"><img src="//assets.ama-assn.org/resources/images/home-page/icon-facebook.png"></img></a></p></div></span>
      <span><div class="container"><p class="footer-social"><a href="//www.twitter.com/" target="_blank"><img src="//assets.ama-assn.org/resources/images/home-page/icon-twitter.png"></img></a></p></div></span>
      <span><div class="container"><p class="footer-social"><a href="//www.linkedin.com/" target="_blank"><img src="//assets.ama-assn.org/resources/images/home-page/icon-linkedin.png"></img></a></p></div></span>
      <span><div class="container"><p class="footer-social"><a href="//www.plus.google.com/" target="_blank"><img src="//assets.ama-assn.org/resources/images/home-page/icon-google.png"></img></a></p></div></span>
    </footer>
  );
}

export default Footer;
